@-moz-document url-prefix("http://www.roblox.com"), url-prefix("https://www.roblox.com"), url-prefix("https://web.roblox.com"), url-prefix("http://web.roblox.com") {
/* All done by JunkieBox */



         .nav-container,
         .nav-container .nav-content {
            background: #000443;
        }


.header-2014 {
        background-color: #2D528F;
    }

  
    
     .navigation .notification-icon {
            background: #2D528F;
        }
     
       #Footer.footer-container {
            background: none;
        }

        
 #Footer.footer-container div.legal {
            border-color: white;
        }


  #Footer.footer-container .dropuplanguagecontainer {
            background: #2D528F;
        }


         #Footer.footer-container .active .LanguageOption:hover {
            background: #000443;
        }


  .header-2014 .header-links div:hover,
         .nav-icon:hover,
         .header-2014 .logo:hover {
            background-color: #2D528F;
        }



           .nav-container .header-2014 .search-icon,
           	 .nav-icon,
             .nav-container .header-2014 .settings-icon,
             .nav-container .header-2014 .robux-icon,
             .nav-container .header-2014 .tickets-icon,
             .nav-container .header-2014 .flyout .upsell-icon,
             .nav-container .navigation .icon {
                background: url(http://images.rbxcdn.com/66412109f54379d8e838721e1f747e37.png) no-repeat;
