            }




.upgrade-now #upgrade-now-button {
  		background-color: #000443 !important;
   
    }

  .upgrade-now {
  		position: absolute !important;
    	bottom: -50px !important;
  		
  		
    }

.nav2014-events {
   		position: absolute !important;
    	bottom: -70px !important;
  }
    
.nav2014-sponsor {
  		position: absolute !important;
    	bottom: -120px !important;
  }

 #Footer.footer-container .Legalese,
 #Footer.footer-container a,
 #Footer.footer-container .FooterNav,
 #header-or {
	        color: white;
        }

.upgrade-now #upgrade-now-button:hover {
            background: #1f1f1f !important;
        }



 #MasterContainer, .nav-content-inner {
         background: url(http://i.imgur.com/ucFAlPo.png) top center repeat-x #2D528F;
    }

 .ad, a[href="/Ads/ReportAd.aspx"], #AdvertisementRight, #AdvertisingLeaderboard, body.other,
        #HomeContainer div.left-column > div.left-column-boxes.text, .Ads_WideSkyscraper,
        .ad-annotations, #Skyscraper-Ad {
        display: none;
    }
}
